import React from "react"
import "./Stylesheets/form.css"
import form from "../Assets/form_background.png"
export default class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            "identity_name": null,
            "identity_class": null,
            "identity_year": null,
        }
        this.years = ["2016-2017", "2017-2018", "2018-2019", "2019-2020", "2020-2021", "2021-2022"]

    }

    render() {
        return (
            <div id = "form">

                <form>
                <img src={form} id="form-bg"></img>
                <input type="text" placeholder=""></input>
                </form>
            </div>
        )
    }

}
